    true,nt"url": null,nt"notes": "<p>This file is a 100 percent summary of
    all Part B Carrier and DMERC Claims processed through the Common Working File and
    stored in the National Claims History Repository. The file is arrayed by carrier,
    pricing locality, Healthcare Common Procedure Coding (HCPC), modifier 1, modifier
    2, specialty, type of service and place of service. The summarized fields are total
    submitted services and charges, total allowed services and charges, total denied
    services and charges, and total payment amounts. This file is produced annually
    and is usually available in July.</p>n",nt"license_title": "Other License
